import {useNavigate} from 'react-router-dom'

function Menu(props){
  let navigate = useNavigate();

  if(props.loginState == false){
    return (
      <div className="visitorMenu">
        <span onClick={()=>{navigte('/login')}}>로그인</span>
        <span>회원가입</span>
      </div>
    )
  }
  return (
    <div className="visitorMenu">
      <span>나의 만다라트</span>
      <span>회원명</span>
    </div>
  )
}

export default Menu;
